INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 1, 190804, "", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 1, 60000, 1, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 2, 0, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 3, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 4, 0, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 2, 60000, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 5, 0, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 6, 0, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 7, 0, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 2, 60000, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 8, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 9, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 10, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 11, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 12, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 2, 60000, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 13, 0, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 14, 0, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 15, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 16, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 2, 60000, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 17, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 2, 60000, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 18, 190804, "", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 3, 60000, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 19, 190804, "", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 3, 60000, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 20, 101201, "", "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1, 0, 80001, 0, "ハツネ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 21, 101201, "", "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 1, 0, 80001, 0, "ハツネ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 22, 103801, "", "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 1, 80001, 0, "シオリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 23, 103801, "", "来年も、\n一緒にいられたら…\nうれしいな", 1, 1, 80001, 0, "シオリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 24, 103601, "", "あなたと一緒にいるようになって、\nもう1年ですか…", 2, 0, 80001, 0, "キョウカ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 25, 103601, "", "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2, 0, 80001, 0, "キョウカ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 26, 102001, "", "おにいちゃんとあってから、\n1年たったよ～！", 2, 1, 80001, 0, "ミミ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 27, 102001, "", "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 1, 80001, 0, "ミミ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 28, 100401, "", "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 2, 80001, 0, "ミソギ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 29, 100401, "", "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 2, 80001, 0, "ミソギ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 30, 101001, "", "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 3, 0, 80001, 0, "マホ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 31, 101001, "", "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 3, 0, 80001, 0, "マホ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 32, 104401, "", "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 3, 1, 80001, 0, "イリヤ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 33, 104401, "", "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 3, 1, 80001, 0, "イリヤ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 34, 101701, "", "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 3, 2, 80001, 0, "カオリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 35, 101701, "", "これからも、どうぞよろしく\nお願いするさ～！", 3, 2, 80001, 0, "カオリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 36, 102801, "", "あんたと出会ってからもうそんなに\nたつのね～", 4, 0, 80001, 0, "サレン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 37, 102801, "", "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 4, 0, 80001, 0, "サレン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 38, 102501, "", "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 4, 1, 80001, 0, "スズメ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 39, 102501, "", "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 4, 1, 80001, 0, "スズメ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 40, 104601, "", "振り返れば、今までいろんなことが\nあったにゃあ…", 5, 0, 80001, 0, "タマキ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 41, 104601, "", "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 5, 0, 80001, 0, "タマキ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 42, 104801, "", "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 5, 1, 80001, 0, "ミフユ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 43, 104801, "", "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 5, 1, 80001, 0, "ミフユ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 44, 103201, "", "あなたさまと出会ってもう1年…", 6, 0, 80001, 0, "アキノ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 45, 103201, "", "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 6, 0, 80001, 0, "アキノ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 46, 103401, "", "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 6, 1, 80001, 0, "ユカリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 47, 103401, "", "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 6, 1, 80001, 0, "ユカリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 48, 107101, "", "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 7, 0, 80001, 0, "クリスティーナ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 49, 107101, "", "ともかくこれからも\n愉しませてくれよ☆", 7, 0, 80001, 0, "クリスティーナ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 50, 104701, "", "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 7, 1, 80001, 0, "ジュン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 51, 104701, "", "見えないから分からないって？\nそれもそうだな…", 7, 1, 80001, 0, "ジュン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 52, 103701, "", "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 8, 0, 80001, 0, "トモ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 53, 103701, "", "これからもよろしくね！", 8, 0, 80001, 0, "トモ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 54, 100501, "", "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 8, 1, 80001, 0, "マツリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 55, 100501, "", "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 8, 1, 80001, 0, "マツリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 56, 100701, "", "オマエと会って1年なの！\n全然成仏もできなかったし、", 9, 0, 80001, 0, "ミヤコ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 57, 100701, "", "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 9, 0, 80001, 0, "ミヤコ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 58, 103101, "", "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 9, 1, 80001, 0, "シノブ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 59, 103101, "", "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 9, 1, 80001, 0, "シノブ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 60, 100901, "", "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 10, 0, 80001, 0, "アンナ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 61, 100901, "", "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 10, 0, 80001, 0, "アンナ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 62, 101301, "", "君と出会ってもう1年だって！\n早いねー！", 10, 1, 80001, 0, "ナナカ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 63, 101301, "", "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 10, 1, 80001, 0, "ナナカ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 64, 105101, "", "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 11, 0, 80001, 0, "ミツキ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 65, 105101, "", "これからも、いろんなところを\n調べさせてね？", 11, 0, 80001, 0, "ミツキ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 66, 105601, "", "お前さんと出会ってもう1年か\n助太刀するつもりが", 11, 1, 80001, 0, "ルカ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 67, 105601, "", "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 11, 1, 80001, 0, "ルカ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 68, 102701, "", "早いものですわね、あなた様と\nお会いして、もう1年…", 11, 2, 80001, 0, "エリコ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 69, 102701, "", "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 11, 2, 80001, 0, "エリコ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 70, 102301, "", "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 12, 0, 80001, 0, "アヤネ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 71, 102301, "", "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 12, 0, 80001, 0, "アヤネ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 72, 104201, "", "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 12, 1, 80001, 0, "チカ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 73, 104201, "", "私のことを見守ってください\nできることなら、ずっと…", 12, 1, 80001, 0, "チカ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 74, 102101, "", "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 12, 2, 80001, 0, "クルミ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 75, 102101, "", "で、でもこれからもずっと…\n一緒にいたいなぁ…", 12, 2, 80001, 0, "クルミ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 76, 104901, "", "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 13, 0, 80001, 0, "シズル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 77, 104901, "", "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 13, 0, 80001, 0, "シズル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 78, 101101, "", "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 13, 1, 80001, 0, "リノ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 79, 101101, "", "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 13, 1, 80001, 0, "リノ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 80, 100201, "", "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 14, 0, 80001, 0, "ユイ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 81, 100201, "", "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 14, 0, 80001, 0, "ユイ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 82, 100101, "", "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 14, 1, 80001, 0, "ヒヨリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 83, 100101, "", "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 14, 1, 80001, 0, "ヒヨリ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 84, 100301, "", "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 14, 2, 80001, 0, "レイ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 85, 100301, "", "キミに背中を預けられる日が、\n早くきますように", 14, 2, 80001, 0, "レイ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 86, 105801, "", "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 15, 0, 80001, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 87, 105801, "", "これからもずっと、覚えていて\nくださいね！", 15, 0, 80001, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 88, 105901, "", "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 15, 1, 80001, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 89, 105901, "", "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 15, 1, 80001, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 90, 106001, "", "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 15, 2, 80001, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 91, 106001, "", "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 15, 2, 80001, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 92, 112101, "", "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, 1, 60001, 1, "スズメ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 93, 0, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 94, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 95, 0, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 96, 0, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 97, 0, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 2, 60001, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 98, 0, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 99, 0, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 100, 0, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 101, 0, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 102, 0, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 2, 60001, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 103, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 104, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 105, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 106, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 107, 0, "", "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 108, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 109, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 2, 60001, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 110, 0, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 111, 0, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 112, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 113, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 114, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 115, 0, "", "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 2, 60001, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 116, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 2, 60001, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 117, 112101, "", "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, 3, 60001, 0, "スズメ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 118, 112101, "", "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 7, 3, 60001, 0, "スズメ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 119, 105801, "", "ヒューヒュー♪\nドンドンパフパフー♪", 1, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 120, 105901, "", "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 121, 105901, "", "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 122, 106001, "", "え？　ちょっと\nいきなりなにっ？", 1, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 123, 106001, "", "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 1, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 124, 105801, "", "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 1, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 125, 105801, "", "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 1, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 126, 105901, "", "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 127, 106001, "", "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 1, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 128, 105901, "", "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 129, 105801, "", "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 1, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 130, 106001, "", "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 1, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 131, 105901, "", "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 132, 106001, "", "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 2, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 133, 190801, "", "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 2, 1, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 134, 106001, "", "げっ…カリンじゃない\nなんでもないわよ！", 2, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 135, 190801, "", "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, 1, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 136, 106001, "", "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 2, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 137, 190801, "", "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 2, 1, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 138, 106001, "", "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 2, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 139, 106001, "", "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 2, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 140, 190801, "", "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 2, 1, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 141, 106001, "", "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 2, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 142, 190801, "", "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 2, 1, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 143, 106001, "", "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 2, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 144, 105901, "", "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 3, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 145, 105801, "", "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 3, 1, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 146, 105901, "", "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 3, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 147, 105901, "", "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 3, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 148, 105801, "", "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 3, 1, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 149, 105801, "", "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 3, 1, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 150, 105901, "", "あとは、牧場に素敵な温泉が\n出来たとか…", 3, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 151, 105801, "", "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 3, 1, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 152, 105901, "", "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 3, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 153, 105801, "", "えへへ、ありがとうございます\nコッコロちゃん！", 3, 1, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 154, 105901, "", "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 3, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 155, 105801, "", "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 3, 1, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 156, 105801, "", "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 4, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 12, 157, 106001, "", "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 4, 1, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 12, 158, 105801, "", "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 4, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 159, 106001, "", "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 4, 1, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 160, 105801, "", "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 4, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 161, 106001, "", "…積極的？\nなんの話よ？", 4, 1, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 162, 105801, "", "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 4, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 163, 105801, "", "ムーサの町で\nきゃるきゃる～ん☆　って！", 4, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 164, 106001, "", "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 4, 1, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 16, 165, 105801, "", "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 4, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 16, 166, 106001, "", "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 4, 1, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 17, 167, 106001, "", "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 4, 1, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 18, 168, 106001, "", "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 5, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 12, 169, 105901, "", "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 5, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 19, 170, 106001, "", "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 5, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 171, 105901, "", "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 5, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 20, 172, 106001, "", "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 5, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 173, 105901, "", "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 5, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 21, 174, 106001, "", "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 5, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 175, 105901, "", "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 5, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 22, 176, 106001, "", "かくし芸？", 5, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 16, 177, 105901, "", "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 5, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 23, 178, 106001, "", "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 5, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 17, 179, 105801, "", "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 6, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 24, 180, 106001, "", "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 6, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 17, 181, 105901, "", "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 6, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 18, 182, 105801, "", "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 6, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 25, 183, 106001, "", "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 6, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 18, 184, 105901, "", "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 6, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 26, 185, 106001, "", "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 6, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 27, 186, 106001, "", "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 6, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 28, 187, 106001, "", "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 6, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 19, 188, 105801, "", "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 6, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 19, 189, 105901, "", "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 6, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 29, 190, 106001, "", "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 6, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 30, 191, 106001, "", "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 31, 192, 106001, "", "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 32, 193, 106001, "", "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 33, 194, 106001, "", "あー\nあー\n…声、これで大丈夫かしら？", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 34, 195, 106001, "", "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 35, 196, 106001, "", "オイッスー☆", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 36, 197, 106001, "", "……\nいや、ないわ\nいつもどおりが一番ね、うん", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 37, 198, 106001, "", "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 38, 199, 106001, "", "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 7, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 20, 200, 105901, "", "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 21, 201, 105901, "", "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 22, 202, 105901, "", "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 23, 203, 105901, "", "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 24, 204, 105901, "", "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 25, 205, 105901, "", "オイッスー☆", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 26, 206, 105901, "", "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 27, 207, 105901, "", "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 28, 208, 105901, "", "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 8, 0, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 20, 209, 105801, "", "オイッスー☆", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 21, 210, 105801, "", "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 22, 211, 105801, "", "あと６日で2.5周年ですか…", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 23, 212, 105801, "", "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 24, 213, 105801, "", "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 25, 214, 105801, "", "オイッスー☆", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 26, 215, 105801, "", "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 27, 216, 105801, "", "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 28, 217, 105801, "", "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 29, 218, 105801, "", "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 30, 219, 105801, "", "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 9, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 31, 220, 105801, "", "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 10, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 29, 221, 105901, "", "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 10, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 32, 222, 105801, "", "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 10, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 39, 223, 106001, "", "…………", 10, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 30, 224, 105901, "", "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 10, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 40, 225, 106001, "", "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 10, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 33, 226, 105801, "", "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 10, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 41, 227, 106001, "", "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 10, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 34, 228, 105801, "", "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 10, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 35, 229, 105801, "", "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 10, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 42, 230, 106001, "", "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 10, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 31, 231, 105901, "", "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 10, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 43, 232, 106001, "", "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 10, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 36, 233, 105801, "", "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 10, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 234, 190801, "", "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 235, 190801, "", "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 236, 190801, "", "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 237, 190801, "", "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 238, 190801, "", "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 239, 190801, "", "次にコッコロさんですが\nこちらは発声練習をしています", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 12, 240, 190801, "", "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 241, 190801, "", "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 242, 190801, "", "あれ？\nもしかして緊張で気を失って…？", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 243, 190801, "", "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 16, 244, 190801, "", "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 17, 245, 190801, "", "それでは\nまた明日お会いしましょう♪", 11, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 44, 246, 106001, "", "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 12, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 37, 247, 105801, "", "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 12, 2, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 32, 248, 105901, "", "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 12, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 45, 249, 106001, "", "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 12, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 38, 250, 105801, "", "ひどいですよぉキャルちゃ～ん！", 12, 2, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 33, 251, 105901, "", "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 12, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 39, 252, 105801, "", "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 12, 2, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 46, 253, 106001, "", "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 12, 0, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 34, 254, 105901, "", "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 12, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 40, 255, 105801, "", "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 12, 2, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 41, 256, 105801, "", "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 13, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 47, 257, 106001, "", "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 13, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 42, 258, 105801, "", "忘れてきちゃいました☆", 13, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 48, 259, 106001, "", "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 13, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 35, 260, 105901, "", "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 13, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 49, 261, 106001, "", "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 13, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 43, 262, 105801, "", "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 13, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 50, 263, 106001, "", "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 13, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 36, 264, 105901, "", "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 13, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 51, 265, 106001, "", "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 13, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 37, 266, 105901, "", "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 13, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 52, 267, 106001, "", "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 13, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 44, 268, 105801, "", "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 13, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 38, 269, 105901, "", "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 13, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 45, 270, 105801, "", "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 13, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 53, 271, 106001, "", "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 13, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 46, 272, 105801, "", "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 13, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 18, 273, 190801, "", "こんにちは\n【ギルド管理協会】のカリンです", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 19, 274, 190801, "", "昨日の生放送は\nいかがだったでしょうか？", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 20, 275, 190801, "", "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 21, 276, 190801, "", "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 22, 277, 190801, "", "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 23, 278, 190801, "", "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 24, 279, 190801, "", "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 25, 280, 190801, "", "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 26, 281, 190801, "", "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 27, 282, 190801, "", "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 14, 0, 80003, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 47, 283, 105801, "", "準備はいいですかっ？\n…いっきますよー！", 15, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 54, 284, 106001, "", "祝！", 15, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 39, 285, 105901, "", "2.5周年！", 15, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 48, 286, 105801, "", "おめでとうございま～す☆", 15, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 55, 287, 106001, "", "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 15, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 40, 288, 105901, "", "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 15, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 49, 289, 105801, "", "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 15, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 56, 290, 106001, "", "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 15, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 41, 291, 105901, "", "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 15, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 57, 292, 106001, "", "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 15, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 50, 293, 105801, "", "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 15, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 58, 294, 106001, "", "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 15, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 51, 295, 105801, "", "記念日だから\n平気平気♪\nやばいですね☆", 15, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 59, 296, 106001, "", "意味分かんないわよ！", 15, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 42, 297, 105901, "", "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 15, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 43, 298, 105901, "", "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 15, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 52, 299, 105801, "", "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 15, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 60, 300, 106001, "", "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 15, 2, 80003, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 44, 301, 105901, "", "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 15, 1, 80003, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 53, 302, 105801, "", "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 15, 0, 80003, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (1, 0, 54, 303, 105801, "105901,45,106001,61", "2.5周年\nありがとうございます！", 15, 0, 80003, 0, "ペコリーヌ・コッコロ・キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 304, 190804, "", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 1, 60002, 1, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 305, 0, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 306, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 307, 0, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 308, 0, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 309, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 2, 60002, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 310, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 311, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 312, 0, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 313, 0, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 314, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 2, 60002, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 315, 0, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 316, 0, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 317, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 318, 0, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 319, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 320, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 321, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 2, 60002, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 322, 0, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 323, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 324, 0, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 325, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 326, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 327, 0, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 2, 60002, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 328, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 2, 60002, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 329, 190804, "", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 3, 60002, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 330, 190804, "", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 3, 60002, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 331, 105901, "", "ささ、シェフィさまはこちらへ…", 1, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 332, 106401, "", "コッコロさん、どこへ行くの…？\n…え？", 1, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 333, 105801, "", "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 334, 105901, "", "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 1, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 335, 106401, "", "ええと…\n二人とも何をしているの？", 1, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 336, 106001, "", "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 337, 106401, "", "あの日…？", 1, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 338, 105801, "", "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 1, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 339, 105801, "", "『プリンセスコネクト！\nRe:Dive』3.5周年！", 1, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 340, 190801, "", "やばいですね☆", 1, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 341, 106001, "", "って、なにしれっと\n参加してんのよカリン！", 1, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 342, 190801, "", "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 1, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 343, 190801, "", "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 1, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 344, 105801, "", "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 1, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 345, 106401, "", "えっ！？　ええとええと…！\nあ、あと14日…！", 1, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 346, 105801, "", "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 2, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 347, 105901, "", "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 2, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 348, 105901, "", "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 2, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 349, 105801, "", "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 2, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 350, 105901, "", "さすがでございます\nペコリーヌさま", 2, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 351, 106001, "", "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 2, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 352, 106401, "", "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 353, 105801, "", "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 2, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 354, 105901, "", "さ、次はキャルさまの\n番でございますよ", 2, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 355, 106001, "", "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 2, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 356, 106401, "", "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 357, 106001, "", "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 2, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 358, 106001, "", "いたたた…もぉお～！\nなんであたしがこんな目に～！", 2, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 359, 105901, "", "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 2, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 360, 106001, "", "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 2, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 361, 105901, "", "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 3, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 362, 105801, "", "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 363, 105901, "", "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 3, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 364, 106401, "", "聖学祭…って、なにかしら？", 3, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 365, 105901, "", "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 3, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 366, 106001, "", "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 3, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 367, 106001, "", "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 3, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 368, 105801, "", "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 369, 106001, "", "いや、そのまんますぎでしょ…", 3, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 370, 106401, "", "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 3, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 371, 105801, "", "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 372, 106401, "", "えっ？　ええ…\nぎゅーっ…？", 3, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 373, 106001, "", "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 4, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 374, 106401, "", "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 4, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 12, 375, 106001, "", "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 4, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 376, 105901, "", "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 4, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 377, 106001, "", "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 4, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 378, 105801, "", "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 4, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 379, 106001, "", "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 4, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 380, 106001, "", "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 4, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 381, 106401, "", "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 4, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 12, 382, 105801, "", "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 4, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 12, 383, 105901, "", "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 4, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 16, 384, 106001, "", "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 4, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 12, 385, 106401, "", "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 4, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 386, 105801, "", "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 5, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 387, 105801, "", "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 5, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 388, 105801, "", "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 5, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 17, 389, 106001, "", "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 5, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 18, 390, 106001, "", "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 5, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 391, 106401, "", "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 5, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 392, 105901, "", "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 5, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 16, 393, 105801, "", "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 5, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 19, 394, 106001, "", "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 5, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 17, 395, 105801, "", "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 5, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 18, 396, 105801, "", "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 5, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 19, 397, 105801, "", "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 5, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 4, 398, 190801, "", "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 6, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 5, 399, 190801, "", "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 6, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 20, 400, 106001, "", "…えっ！？", 6, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 20, 401, 105801, "", "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 6, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 402, 106401, "", "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 6, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 403, 105901, "", "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 6, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 404, 106401, "", "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 6, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 21, 405, 106001, "", "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 6, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 21, 406, 105801, "", "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 6, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 22, 407, 106001, "", "ぶっ殺すぞ！？", 6, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 6, 408, 190801, "", "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 409, 105901, "", "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 7, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 23, 410, 106001, "", "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 7, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 16, 411, 106401, "", "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 7, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 22, 412, 105801, "", "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 7, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 24, 413, 106001, "", "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 7, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 17, 414, 106401, "", "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 7, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 16, 415, 105901, "", "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 7, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 18, 416, 106401, "", "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 7, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 17, 417, 105901, "", "もちろんでございます\n仲良くお勉強いたしましょう", 7, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 25, 418, 106001, "", "しれっと教育ママが\n生まれてる…？", 7, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 23, 419, 105801, "", "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 7, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 26, 420, 106001, "", "え～～～～！？", 7, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 27, 421, 106001, "", "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 8, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 19, 422, 106401, "", "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 8, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 18, 423, 105901, "", "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 8, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 24, 424, 105801, "", "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 8, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 20, 425, 106401, "", "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 8, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 28, 426, 106001, "", "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 8, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 19, 427, 105901, "", "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 8, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 21, 428, 106401, "", "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 8, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 29, 429, 106001, "", "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 8, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 30, 430, 106001, "", "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 8, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 25, 431, 105801, "", "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 8, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 31, 432, 106001, "", "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 8, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 22, 433, 106401, "", "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 23, 434, 106401, "", "…えっ？\n生放送の意気込み！？\n突然なに！？", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 24, 435, 106401, "", "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 25, 436, 106401, "", "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 26, 437, 106401, "", "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 27, 438, 106401, "", "それから、それから…！\nぅ、ぅぅっ…！", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 28, 439, 106401, "", "―びえぇぇ～んっ！！！", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 20, 440, 105901, "", "どうされましたか、シェフィさま", 9, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 29, 441, 106401, "", "ううっ…ひっく…\nママッ…！", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 21, 442, 105901, "", "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 9, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 22, 443, 105901, "", "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 9, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 30, 444, 106401, "", "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 9, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 23, 445, 105901, "", "主さま\n3.5周年まであと５日\nでございます", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 24, 446, 105901, "", "ですがその前に\n生放送がありますね", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 25, 447, 105901, "", "…生放送に向けた\n意気込みでございますか？", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 26, 448, 105901, "", "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 27, 449, 105901, "", "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 28, 450, 105901, "", "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 29, 451, 105901, "", "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 30, 452, 105901, "", "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 31, 453, 105901, "", "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 10, 0, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 26, 454, 105801, "", "3.5周年まであと４日！\nやばいですね☆", 11, 0, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 32, 455, 106001, "", "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 11, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 27, 456, 105801, "", "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 11, 0, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 28, 457, 105801, "", "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 11, 0, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 29, 458, 105801, "", "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 11, 0, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 33, 459, 106001, "", "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 11, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 30, 460, 105801, "", "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 11, 0, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 31, 461, 105801, "", "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 11, 0, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 32, 462, 105801, "", "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 11, 0, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 34, 463, 106001, "", "だからあたしはやるなんて一言も…", 11, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 33, 464, 105801, "", "オイッスー☆", 11, 0, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 35, 465, 106001, "", "聞きなさいっての！！", 11, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 31, 466, 106401, "", "3.5周年まであと３日…\nそして生放送は、明日…", 12, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 32, 467, 106401, "", "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 12, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 33, 468, 106401, "", "おいっす！\n…こうじゃなかったわね\nええと確か…", 12, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 34, 469, 106401, "", "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 12, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 35, 470, 106401, "", "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 12, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 34, 471, 105801, "", "やってますねシェフィちゃん！", 12, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 36, 472, 106001, "", "なによ、考えることは\nみんな同じってこと？", 12, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 32, 473, 105901, "", "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 12, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 36, 474, 106401, "", "みんな…もちろんよ！", 12, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 35, 475, 105801, "", "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 12, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 7, 476, 190801, "", "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 13, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 8, 477, 190801, "", "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 13, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 36, 478, 105801, "", "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 13, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 9, 479, 190801, "", "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 13, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 33, 480, 105901, "", "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 13, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 10, 481, 190801, "", "さすが【美食殿】のママですね！\nそしてキャルさんは…", 13, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 37, 482, 106001, "", "大丈夫…大丈夫…\nあたしは大丈夫…", 13, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 11, 483, 190801, "", "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 13, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 37, 484, 106401, "", "あうー？", 13, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (1, 0, 37, 485, 105801, "105901,34,106001,38,190801,12", "あ…", 13, 4, 80005, 0, "みんな");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 39, 486, 106001, "", "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 13, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 35, 487, 105901, "", "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 13, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 38, 488, 105801, "", "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 13, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 13, 489, 190801, "", "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 38, 490, 106401, "", "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 14, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 39, 491, 105801, "", "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 14, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 40, 492, 106001, "", "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 14, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 36, 493, 105901, "", "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 14, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 39, 494, 106401, "", "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 14, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 40, 495, 105801, "", "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 14, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 37, 496, 105901, "", "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 14, 1, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 41, 497, 106001, "", "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 14, 0, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 40, 498, 106401, "", "へ、へぇ…", 14, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 41, 499, 105801, "", "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 14, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 41, 500, 106401, "", "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 14, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 42, 501, 106401, "", "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 14, 2, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 42, 502, 105801, "", "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 15, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 42, 503, 106001, "", "祝！", 15, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 38, 504, 105901, "", "3.5周年！", 15, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 43, 505, 106401, "", "おめでとうございます！", 15, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 14, 506, 190801, "", "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 15, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 15, 507, 190801, "", "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, 2, 80005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 43, 508, 105801, "", "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 15, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 44, 509, 105801, "", "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 15, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 43, 510, 106001, "", "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 15, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 44, 511, 106001, "", "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 15, 1, 80005, 0, "キャル");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 44, 512, 106401, "", "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 15, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 45, 513, 106401, "", "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 15, 0, 80005, 0, "シェフィ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 39, 514, 105901, "", "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 15, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 40, 515, 105901, "", "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 15, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 41, 516, 105901, "", "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 15, 4, 80005, 0, "コッコロ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 45, 517, 105801, "", "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 15, 3, 80005, 0, "ペコリーヌ");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (1, 0, 46, 518, 105801, "105901,42,106001,45,106401,46,190801,16", "これからも\nよろしくおねがいします！", 15, 4, 80005, 0, "みんな");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 1, 519, 190804, "", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 1, 60003, 1, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 520, 0, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 521, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 522, 0, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 523, 0, "", "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 1, 0, 524, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 2, 60003, 2, "");
