INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 530, 0, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 531, 0, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 532, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 533, 0, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 534, 0, "", "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 2, 60003, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 535, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 2, 60003, 1, "");
