INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 579, 0, "", "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 580, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 581, 0, "", "今日の運勢は大吉！　日々の努力が実り、何事も良い方向へ！　　そんな弟くんには、お姉ちゃんのよしよしぎゅ～っをプレゼント♪", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 582, 0, "", "今日の運勢は大吉！　お出かけするといいことあるかも？　　　　また一緒に、お忍びデートしてくださいね……騎士♪", 0, 2, 60005, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 2, 0, 583, 0, "", "今日の運勢は大吉！　転居するならあたたかい場所が吉！　　　　煉獄の世なれど、住めば都と申しんす。ゆるりときなんせ……♪", 0, 2, 60005, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 584, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 585, 0, "", "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 586, 0, "", "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 587, 0, "", "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 588, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 589, 0, "", "今日の運勢は中吉！　争いごとは勝つが油断は大敵！　　　　　　ま、このあたしと一緒なら、向かうところ敵はねーですよっ！", 0, 2, 60005, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 3, 0, 590, 0, "", "今日の運勢は中吉！　ラッキーアイテムは「光るもの」！　　　　ハツネちゃんの「きらーんっ☆」な魔法、見せちゃおうかなっ？", 0, 2, 60005, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 591, 0, "", "今日の運勢は小吉！　のんびり穏やかな一日となるでしょう！　　あなた様を邪魔するものは全てエリコが排除しますわ、クスクス♪", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 592, 0, "", "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 593, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 594, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 595, 0, "", "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0, 2, 60005, 1, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 596, 0, "", "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", 0, 2, 60005, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 4, 0, 597, 0, "", "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 0, 2, 60005, 2, "");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 2, 598, 190804, "", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 3, 60005, 0, "カリン");
INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES (0, 0, 3, 599, 190804, "", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 3, 60005, 0, "カリン");
